            .container {

                margin: 40px 0;
                height: 60px;
            }

            .line {
                height: 1px;
                background-color: #E8E8EF;
            }

            .text {
                margin-top: 56px;

                color: #5A5F77;
                font-size: 16px;

                font-weight: 700;
                margin-bottom: 24px;
            }

                display: flex;
                gap: 8px;
                margin-bottom: 16px;
            }

                display: flex;
            }

                color: #0970FF;
            }

            .link a {
                text-decoration: none;
                gap: 8px;
                display: flex;
                align-items: center;
            }

            .link img {
                width: 16px;
                height: 16px;
            }

            @media only screen and (min-device-width : 320px) and (max-device-width : 480px) {
                .logo {
                    margin: 80px 0;
                    height: 120px;
                }

                .text {
                    margin-top: 112px;
                    font-size: 14px;
                    line-height: 32px;
                }

                .text-header {
                    margin-bottom: 48px;
                }

                .container {
                    padding: 0 64px;
                }

                .link img {
                    width: 30px;
                    height: 30px;
                }

                .link a {
                    font-size: 2.3em;
                }
            }
